import React from "react";
import ReactDOM from "react-dom";
import {add,sub,mult,div} from "./App";
ReactDOM.render(<>
<ul>
<li>sum of two no-  {add(7,8)}</li>
<li>sub of two no-  {sub(8,7)}</li>
<li>mult of two no-  {mult(7 ,8)}</li>
<li>div of two no-  {div(9,3)}</li>

</ul>
</>,
document.getElementById('root')
	);
